import Book from "./Book";
import Boook from "./data"
function BookList({ Boook }) {
  return (
    <>
       {console.log(Boook)}
      {Boook.map((book) => (
        <Book
          key={book.id}
          Image={book.Image}
          Name={book.Name}
          Author={book.Author}
          Publisher={book.Publisher}
          Avability={book.Avability}
          Ledger={book.Ledger}
          id={book.id}
        
        />
      ))}
          </>
  );
}
export default BookList;
